import React from "react";
import Navbar from "../components/Navbar";
import Intro from "../components/Intro";
import Cards from "../components/cards";

const Home = () => {
  return (
    <>
  <Navbar />
  <Intro />
  <div className="card-group">
  <Cards heading='APOD' img='https://api.nasa.gov/assets/img/general/apod.jpg' para='One of the most popular websites at NASA is the Astronomy Picture of the Day. In fact, this website is one of the most popular websites across all federal agencies. It has the popular appeal of a Justin Bieber video. This endpoint structures the APOD imagery and associated metadata so that it can be repurposed for other applications. In addition, if the concept_tags parameter is set to True, then keywords derived from the image explanation are returned. These keywords could be used as auto-generated hashtags for twitter or instagram feeds; but generally help with discoverability of relevant imagery.

The full documentation for this API can be found in the APOD API Github repository.' />
  <Cards heading='Asteroids - NeoWs' img='https://api.nasa.gov/assets/img/general/apod.jpg' para='NeoWs (Near Earth Object Web Service) is a RESTful web service for near earth Asteroid information. With NeoWs a user can: search for Asteroids based on their closest approach date to Earth, lookup a specific Asteroid with its NASA JPL small body id, as well as browse the overall data-set.

Data-set: All the data is from the NASA JPL Asteroid team (http://neo.jpl.nasa.gov/).

This API is maintained by SpaceRocks Team: David Greenfield, Arezu Sarvestani, Jason English and Peter Baunach.' />
  <Cards heading='APOD' img='https://api.nasa.gov/assets/img/general/apod.jpg' para='' />
  <Cards heading='APOD' img='https://api.nasa.gov/assets/img/general/apod.jpg' para='lorem' />
  <Cards heading='APOD' img='https://api.nasa.gov/assets/img/general/apod.jpg' para='lorem' />
  <Cards heading='APOD' img='https://api.nasa.gov/assets/img/general/apod.jpg' para='lorem' />
</div>
  </>
  );
};


export default Home;
